const Root = () => {
	<Router>
		<Switch>
			<Route path='/' component={App} />
		</Switch>
	</Router>;
};

ReactDOM.render(
	<React.StrictMode>
		<App />
	</React.StrictMode>,
	document.getElementById('root')
);

